import style from "./App.module.css";
import Navbar from "./Components/UI/NavBar";
import {AuthContextProvider} from "./Storage/AuthContext";
import Content from "./Components/Content";
import {FoodData} from "./Storage/FoodContext"
import {useEffect} from "react"
import {usePostFB} from ""

function App() {
  const [posttFood] = usePostFB("https://react-s16-http-request-default-rtdb.asia-southeast1.firebasedatabase.app/leifs-food.json");
  useEffect(() => {

    const tobePostedFood = [];

    for (let key in FoodData) {
      tobePostedFood.push({
        id: key,
        row: FoodData[key].row,
        name: FoodData[key].name,
        price: FoodData[key].price,
        description: FoodData[key].description,
        img: FoodData[key].img,
      });
    }

    posttFood(tobePostedFood);
  });
  return (
    <AuthContextProvider>
      <div className={style.main}>
        <Navbar/>
        <Content/>
      </div>
    </AuthContextProvider>
  );
}

export default App;
